// SPDX-License-Identifier: MIT
pragma solidity ^0.8.4;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/Arrays.sol";
import "./MetaPassport.sol";
import "./MetaPassportAvatarPart.sol";
import "./MetaPassportAvatarSet.sol";
import "./MetaPassportAvatarSetConfig.sol";
import "./MetaPassportWhitelist.sol";

contract MetaPassportMinter is Ownable {

    address private _cooAddr;
    address payable private _cfoAddr;
    bool private _isWhitelistMode;

    uint256 private _mint1Fee;
    uint256 private _mint2Fee;
    uint256 private _mint3Fee;
    uint256 private _mint4Fee;
    uint256 private _mintBoxFee;

    uint private constant MINT_TYPE_1 = 1;
    uint private constant MINT_TYPE_2 = 2;
    uint private constant MINT_TYPE_3 = 3;
    uint private constant MINT_TYPE_4 = 4;
    uint private constant MINT_TYPE_BOX = 10;

    uint private constant BOX_OPEN_STATUS_NOT_OPEN = 0;
    uint private constant BOX_OPEN_STATUS_CREATE_ORDER = 1;
    uint private constant BOX_OPEN_STATUS_OPENED = 2;

    MetaPassport private _metapassport;
    MetaPassportAvatarPart private _metapassportAvatarPart;
    MetaPassportAvatarSet private _metapassportAvatarSet;
    MetaPassportAvatarSetConfig private _metapassportAvatarSetConfig;
    MetaPassportWhitelist private _whitelist;

    struct MintOrder {
        uint mintType;
        address from;
        uint[2] params;
        uint orderIndex;
    }

    struct MysteryBoxRound {
        uint256 round;
        uint256 endTime;
        uint256 totalLimit;
        uint256 userLimit;
    }

    MintOrder[] private _mintOrders;
    MysteryBoxRound public mysteryBoxCurrentRound;
    mapping(uint256 => mapping(uint256 => mapping(uint256 => uint))) private _mysteryBoxOpened;  // round => (mpTokenId => (slot => status))
    mapping(address => bool) _mintOnceMap;  // address => has created mint1~4 order

    event MintOrderCreated(uint mintType, address from, uint[2] params, uint orderIndex);
    event MintOrderHandled(uint orderIndex);
    event MysteryBoxSlotOpen(uint round, uint mpTokenId, uint slot, uint setId);
    event MysteryBoxRoundUpdate(uint256 round, uint256 endTime, uint256 totalLimit, uint256 userLimit);

    constructor(address cooAddr, address payable cfoAddr) {
        _cooAddr = cooAddr;
        _cfoAddr = cfoAddr;
        _isWhitelistMode = true;
        _mint1Fee = 1 * (10 ** 15);     // 0.001 eth
        _mint2Fee = 2 * (10 ** 15);     // 0.002 eth
        _mint3Fee = 3 * (10 ** 15);     // 0.003 eth
        _mint4Fee = 4 * (10 ** 15);     // 0.004 eth
        _mintBoxFee = 2 * (10 ** 15);     // 0.002 eth
    }
    
    ////////////////////////////
    // owner functions 
    ////////////////////////////

    function initContracts(MetaPassport mpAddr, MetaPassportAvatarPart mpAvatarPartAddr, MetaPassportAvatarSet mpAvatarSetAddr, MetaPassportAvatarSetConfig mpAvatarSetConfigAddr) public {
        _metapassport = mpAddr;
        _metapassportAvatarPart = mpAvatarPartAddr;
        _metapassportAvatarSet = mpAvatarSetAddr;
        _metapassportAvatarSetConfig = mpAvatarSetConfigAddr;
    }

    function setWhitelistContract(MetaPassportWhitelist newWhitelistAddr) public onlyCOO {
        _whitelist = newWhitelistAddr;
        if(address(_whitelist) == address(0x0)) {
            _isWhitelistMode = false;
        }else{
            _isWhitelistMode = true;
        }
    }

    function withdraw() public onlyCFO {
        _cfoAddr.transfer(address(this).balance);
    }

    function setCOO(address cooAddr) public onlyOwner {
        _cooAddr = cooAddr;
    }

    function setCFO(address payable cfoAddr) public onlyOwner {
        _cfoAddr = cfoAddr;
    }

    function mintByCOO(address to) public onlyCOO {
        _metapassport.safeMint(to);
    }

    ////////////////////////////
    // mystery box functions
    ////////////////////////////

    function getBlockTime() public view returns(uint256) {
        return block.timestamp;
    }

    // endTime : seconds
    function setMysteryBoxRound(uint256 round, uint256 endTime, uint256 totalLimit, uint256 userLimit) public onlyCOO {
        mysteryBoxCurrentRound = MysteryBoxRound(round, endTime, totalLimit, userLimit);
        emit MysteryBoxRoundUpdate(round, endTime, totalLimit, userLimit);
    }

    function getMysteryBoxRoundEndTime() public view returns(uint256) {
        return mysteryBoxCurrentRound.endTime;
    }

    function getMysteryBoxRoundInfo() public view returns(MysteryBoxRound memory) {
        return mysteryBoxCurrentRound;
    }

    function isMysteryBoxRoundOpening() public view returns(bool) {
        uint256 endTime = getMysteryBoxRoundEndTime();
        return endTime > 0 && block.timestamp < endTime;
    }

    function getSlotOpenStatus(uint256 mpTokenId, uint slot) public view returns(uint) {
        return _mysteryBoxOpened[mysteryBoxCurrentRound.round][mpTokenId][slot];
    }

    function _setSlotOpenStatus(uint256 mpTokenId, uint slot, uint status) private {
        _mysteryBoxOpened[mysteryBoxCurrentRound.round][mpTokenId][slot] = status;
    }

    function mintMysteryBox(uint8[] memory slots) public payable {
        require(isMysteryBoxRoundOpening(), "MetaPassportMinter: mystery box is not opening");
        require(slots.length < mysteryBoxCurrentRound.userLimit, "MetaPassportMinter: mystery box slots count > user limit");
        require(msg.value == _mintBoxFee * slots.length, "MetaPassportMinter: invalid mint fee");

        uint256 mpTokenId = _metapassport.getMetaPassport(msg.sender);
        require(mpTokenId > 0, "MetaPassportMinter: should own metapassport first");

        for(uint i=0; i<slots.length; i++) {
            uint slot = slots[i];
            require(slot < mysteryBoxCurrentRound.userLimit, "MetaPassportMinter: invalid mystery box slot");
            require(getSlotOpenStatus(mpTokenId, slot) == BOX_OPEN_STATUS_NOT_OPEN, "MetaPassportMinter: slot is opened");

            _setSlotOpenStatus(mpTokenId, slot, BOX_OPEN_STATUS_CREATE_ORDER);
            uint[2] memory p = [slot, mpTokenId];
            _createMintOrder(MINT_TYPE_BOX, msg.sender, p);
        }
    }

    function _mintMysteryBox(address to, uint slot, uint mpTokenId, uint seed) private  {
        require(getSlotOpenStatus(mpTokenId, slot) == BOX_OPEN_STATUS_CREATE_ORDER, "MetaPassportMinter: invalid slot status");
        _setSlotOpenStatus(mpTokenId, slot, BOX_OPEN_STATUS_OPENED);
        uint256 setId = _metapassportAvatarSetConfig.getRandomSet(seed);
        _metapassportAvatarSet.safeMint(to, setId);
        emit MysteryBoxSlotOpen(mysteryBoxCurrentRound.round, mpTokenId, slot, setId);
    }

    ////////////////////////////
    // user functions 
    ////////////////////////////

    // mint type 1: only mp
    function mint1() public payable checkWhitelist notOwnedMetaPassport {
        require(msg.value == _mint1Fee, "MetaPassportMinter: invalid mint fee");
        _mintOnce(msg.sender);
        uint[2] memory p;
        _createMintOrder(MINT_TYPE_1, msg.sender, p);
    }

    function _mint1(address to) private {
        _metapassport.safeMint(to);
    }

    // mint type 2: mp + random avatar set
    function mint2() public payable checkWhitelist notOwnedMetaPassport {
        require(msg.value == _mint2Fee, "MetaPassportMinter: invalid mint fee");
        _mintOnce(msg.sender);
        uint[2] memory p;
        _createMintOrder(MINT_TYPE_2, msg.sender, p);
    }

    function _mint2(address to, uint seed) private {
        _metapassport.safeMint(to);
        uint256 setId = _metapassportAvatarSetConfig.getRandomSet(seed);
        _metapassportAvatarSet.safeMint(to, setId);
    }

    // mint type 3: mp + random avatar set(limit base)
    function mint3(uint256 baseId) public payable checkWhitelist notOwnedMetaPassport {
        require(msg.value == _mint3Fee, "MetaPassportMinter: invalid mint fee");
        _mintOnce(msg.sender);
        _metapassportAvatarSetConfig.checkRandomSetBase(baseId);
        uint[2] memory p = [baseId, 0];
        _createMintOrder(MINT_TYPE_3, msg.sender, p);
    }

    function _mint3(address to, uint256 baseId, uint seed) private {
        _metapassport.safeMint(to);
        uint256 setId = _metapassportAvatarSetConfig.getRandomSetByBase(seed, baseId);
        _metapassportAvatarSet.safeMint(to, setId);
    }

    // mint type 4: mp + random avatar set(limit base and series)
    function mint4(uint256 baseId, uint256 series) public payable checkWhitelist notOwnedMetaPassport {
        require(msg.value == _mint4Fee, "MetaPassportMinter: invalid mint fee");
        _mintOnce(msg.sender);
        _metapassportAvatarSetConfig.checkRandomSetBaseAndSeries(baseId, series);
        uint[2] memory p = [baseId, series];
        _createMintOrder(MINT_TYPE_4, msg.sender, p);
    }

    function _mint4(address to, uint256 baseId, uint256 series, uint seed) private {
        _metapassport.safeMint(to);
        uint256 setId = _metapassportAvatarSetConfig.getRandomSetByBaseAndSeries(seed, baseId, series);
        _metapassportAvatarSet.safeMint(to, setId);
    }

    function _mintOnce(address minter) private {
        require(_mintOnceMap[minter] == false, "MetaPassportMinter: minter has created mint1~4 order");
        _mintOnceMap[minter] = true;
    }

    ////////////////////////////
    // mint order
    ////////////////////////////

    function _createMintOrder(uint mintType, address from, uint[2] memory params) private {
        uint index = _mintOrders.length + 1;
        _mintOrders.push(MintOrder(mintType, from, params, index));
        emit MintOrderCreated(mintType, from, params, index);
    }

    function handleMintOrder(uint orderIndex) external onlyCOO {
        require(_mintOrders[orderIndex - 1].orderIndex == orderIndex, "MetaPassportMinter: invalid order index");

        MintOrder memory o = _mintOrders[orderIndex - 1];

        if(o.mintType == MINT_TYPE_BOX) {
            _mintMysteryBox(o.from, o.params[0], o.params[1], orderIndex);
        }else if(o.mintType == MINT_TYPE_1) {
            _mint1(o.from);
        }else if(o.mintType == MINT_TYPE_2) {
            _mint2(o.from, orderIndex);
        }else if(o.mintType == MINT_TYPE_3) {
            _mint3(o.from, o.params[0], orderIndex);
        }else if(o.mintType == MINT_TYPE_4) {
            _mint4(o.from, o.params[0], o.params[1], orderIndex);
        }else{
            revert();
        }

        delete _mintOrders[orderIndex - 1];
        emit MintOrderHandled(orderIndex);
    }

    ////////////////////////////
    // other functions
    ////////////////////////////

    function metapassport() public view virtual returns (address) {
        return address(_metapassport);
    }

    function whitelistAddr() public view virtual returns (address) {
        return address(_whitelist);
    }

    function coo() public view virtual returns (address) {
        return _cooAddr;
    }

    function cfo() public view virtual returns (address) {
        return _cfoAddr;
    }

    function mint1Fee() public view virtual returns (uint256) {
        return _mint1Fee;
    }

    function mint2Fee() public view virtual returns (uint256) {
        return _mint2Fee;
    }

    function mint3Fee() public view virtual returns (uint256) {
        return _mint3Fee;
    }

    function mint4Fee() public view virtual returns (uint256) {
        return _mint4Fee;
    }

    function mintBoxFee() public view virtual returns (uint256) {
        return _mintBoxFee;
    }

    function isWhitelistMode() public view virtual returns (bool) {
        return _isWhitelistMode;
    }

    modifier onlyCOO() {
        require(coo() == msg.sender, "MetaPassportMinter: caller is not the coo");
        _;
    }

    modifier onlyCFO() {
        require(cfo() == msg.sender, "MetaPassportMinter: caller is not the cfo");
        _;
    }

    modifier checkWhitelist() {
        require(isWhitelistMode() == false || _whitelist.isWhitelisted(msg.sender), "MetaPassportMinter: caller is not in the whitelist");
        _;
    }

    modifier notOwnedMetaPassport() {
        require(_metapassport.balanceOf(msg.sender) == 0, "MetaPassportMinter: caller cannot owned metapassport");
        _;
    }

}
